import './css/App.css';
import {
    BrowserRouter,
    Routes,
    Route
  } from "react-router-dom";
import SearchCriteria from './components/SearchCriteria';
import {  } from "module";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Header/>
      <SearchCriteria/>
        <Routes>
            <Route path="/profileBrowser" element={<ProfileBrowser/>}/>
            <Route path ="/about" element = {<About/>}/>
            <Route path="/results/:id" element ={<Results/>}/>
            <Route path="/form" element ={<Form/>}/>
        </Routes>
      <Footer/>
      </BrowserRouter>
    </div>
  );
}

export default App;
